import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import MyApp from "./../App.js"; // Assuming you have a MyApp component

function App() {
    return (
        <Router>
          
                <Route path="/" element={<MyApp />} />

        </Router>
    );
}

export default App;
